Verenigde Staten
Horror / Thriller
105 minuten

een goeie film

met Famke Janssen, Ed Westwick en Bobby Cannavale

Marnie Watson heeft celstraf gekregen toen ze haar eigen man, een politieman, heeft vermoord uit zelfverdediging. Maar Marnie 
wordt plotseling vervroegd vrijgelaten uit de gevangenis, aangezien ze met een elektronische band om haar been de rest van haar 
straf in haar eigen huis mag doorbrengen. En terwijl een collega van haar overleden man buiten haar huis in een auto zit te 
wachten tot ze de fout ingaat, ontdekt Marnie dat haar overleden man zelf nog steeds in het huis rondspookt. En hij wil niets 
liever dan wraak nemen.
